import React from 'react';
import {aidos} from '../overview/aidos.png'
import 'bootstrap/dist/css/bootstrap.css';
import './index.css'



function OverviewThreeComponent() {
    return (
        <div>
            <h3 className='center3'>Nominations</h3>
            <div class="container">
  <div class="row">
    <div class="col"><img className='photo' src="https://www.linkpicture.com/q/PHOTO-2023-02-13-11-19-49.jpg" alt="pic" /> </div>
    <div class="col">  <img className='photo' src="https://www.linkpicture.com/q/PHOTO-2023-02-11-13-19-40-1.jpg" alt="pic" /> </div>
    <div class="w-100"></div>
    <div class="col">Daryn FIRST Championship - Design Award 1st place</div>
    <div class="col"> <img className='photo' src="https://www.linkpicture.com/q/PHOTO-2023-02-13-11-19-49.jpg" alt="pic" /> </div>
  </div>
  Haileybury FIRST Championship - Connect Award 1st place
</div>

        </div>
    );
}

export default OverviewThreeComponent;
